import{_ as t,c as o,o as n,ah as r}from"./chunks/framework.PvdZnrZd.js";const c=JSON.parse('{"title":"VAMASHIP SHIPPING","description":"VAMASHIP SHIPPING","frontmatter":{"title":"VAMASHIP SHIPPING","description":"VAMASHIP SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/vamaship.md","filePath":"zenith/featured-app/shipping/vamaship.md"}'),a={name:"zenith/featured-app/shipping/vamaship.md"};function i(s,e,p,l,g,h){return n(),o("div",null,[...e[0]||(e[0]=[r('<p><a href="https://webkul.com/blog/shopify-multivendor-marketplace-new-theme-launched/" target="_blank" rel="noreferrer">Multi-Vendor Marketplace for Shopify</a> has come up with another marketplace shipping feature app for <strong>Indian Merchants</strong>, i.e., <strong>Vamaship</strong>.</p><h2 id="vamaship" tabindex="-1">Vamaship <a class="header-anchor" href="#vamaship" aria-label="Permalink to &quot;Vamaship&quot;">​</a></h2><p><a href="https://www.vamaship.com/" target="_blank" rel="noreferrer">Vamaship</a> is a SaaS enabled logistics marketplace. Besides, it facilitates shipping via air, ocean, and surface to over 200 countries and 26,000 pin codes within India.</p><p>Using this featured app, the merchants can enable shipment &amp; fulfillment through Vamaship. Moreover, he can automatically generate shipping labels for the same.</p><p>The <strong>Vamaship</strong> feature app is available only with the Multivendor <strong>Pro</strong> <strong>Plan</strong> ($60/month). Moreover, you need to enable the <a href="https://webkul.com/blog/shopify-multivendor-marketplace-shipping/" target="_blank" rel="noreferrer"><strong>Shipping</strong></a> add-on (free) from the featured apps section of the app.</p><p><strong>CHARGES:</strong></p><p>This feature will have an additional charge of <strong>USD 10 per month</strong> over &amp; above your current Multivendor plan.</p><p><strong>NOTE:</strong></p><p>Access to Shipping requires your Shopify store to be on the plan that supports <strong>Real-Time Carrier-Calculated Shipping</strong>.</p><p>THE VAMASHIP SHIPPING FEATURE APP IS AVAILABLE FOR BOTH <strong>RATE CALCULATION &amp; FULFILLMENT</strong>.</p><h2 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h2><p>To enable this &#39;feature app&#39;:</p><p>Go to <strong>multi vendor marketplace admin panel</strong> &gt; click on the <strong>three dots</strong> &gt; click on the &#39;<strong>featured apps&#39;</strong>. Further, <strong>enable</strong> the Vamaship add-on.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/vamaship.webp" alt="feature app"></p><p>Furthermore, agree &amp; approve the charges:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/agreevama.webp" alt="PAYMENT"></p><p>MultiVendor Marketplace Admin End</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/demo-store-Approve-fees-Shopify-1.png" alt="APPROVE CHARGES"></p><p>Shopify Backend (Admin End)</p><h3 id="configuration-admin-end" tabindex="-1">Configuration: Admin End <a class="header-anchor" href="#configuration-admin-end" aria-label="Permalink to &quot;Configuration: Admin End&quot;">​</a></h3><p>Firstly, go to:<br><strong>Multi-vendor marketplace admin panel</strong> &gt; <strong>configuration</strong> &gt; <strong>shipping</strong> <strong>configuration</strong>. Now, <strong>enable</strong> the shipping method:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/enablevamaship.webp" alt="ENABLE SHIPPING"></p><p>MultiVendor Marketplace Admin End</p><p>After that, you&#39;ll have one more option to configure this shipping.</p><p>So, either click on <strong>Configure Shipping</strong><br> OR<br> Go to <strong>multi vendor marketplace admin panel</strong> &gt; <strong>configuration</strong> &gt; <strong>Vamaship Configuration</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/viewsellersvamaship.webp" alt="CONFIGURE SHIPPING"></p><p>MultiVendor Marketplace Admin End</p><p>Hence, this is what the configuration page will look like:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/vamashipconfig.webp" alt="Vamaship-Post-Configuration-Admin"></p><p>MultiVendor Marketplace Admin End</p><ul><li><strong>SANDBOX MODE</strong></li></ul><p>If you want to test the functionality of this shipping add-on, enable the sandbox mode. So, use the sandbox mode for testing purposes only.</p><ul><li><strong>AUTOMATIC GENERATE SHIPPING LABEL</strong></li></ul><p>Enable this to automatically generate a shipping label on order fulfillment.</p><ul><li><strong>VAMASHIP ACCESS KEY</strong></li></ul><p>Further, in here, enter the API Username, i.e., the left part of the API key, before the colon. (It will be different for the Production and Development environment.)</p><p>Contact <a href="https://www.vamaship.com/" target="_blank" rel="noreferrer">Vamaship</a> to get the access key.</p><ul><li><p><strong>CHOOSE SERVICE TYPE</strong></p><ul><li><strong>Vamaship Air Domestic</strong>:<br> This is for providing shipping within India via air. <a href="https://vamaship.docs.apiary.io/#" target="_blank" rel="noreferrer">Know more</a>.</li><li><strong>Vamaship Air International:</strong><br> This is international shipping. The seller needs to be located in <strong>Mumbai</strong>, <strong>India</strong>. <a href="https://apiary.io/" target="_blank" rel="noreferrer">Know more</a>.</li><li><strong>Vamaship Surface Domestic:</strong><br> This is for providing shipping within India via surface. <a href="https://vamashipsurface.docs.apiary.io/#" target="_blank" rel="noreferrer">Know more</a>.</li></ul></li><li><p><strong>SHIPPING LABEL COST BORNE BY</strong></p></li></ul><p>Further, choose who will bear the shipping label charges, thus, the admin or the seller. (This is an extra cost apart from what the customer has paid.)</p><ul><li><strong>USAGE AS</strong></li></ul><p>Select how you want to use Vamaship: For fulfilment or Both fulfilment &amp; shipping.</p><p><strong>Note</strong>: If you are using it for fulfillment only then customers will not get Vamaship shipping rates on the checkout page. That is, you will only be able to fulfil orders via Vamaship.</p><h2 id="set-shipping-method-for-sellers" tabindex="-1">Set Shipping Method for Sellers: <a class="header-anchor" href="#set-shipping-method-for-sellers" aria-label="Permalink to &quot;Set Shipping Method for Sellers:&quot;">​</a></h2><p>The admin can further set the shipping methods for his sellers. So, go to <strong>multi vendor marketplace admin panel</strong> &gt; <strong>Sellers</strong> &gt; <strong>Seller Listing</strong> &gt; <strong>Edit</strong> (under <strong>Action</strong>).<br> On the edit seller page, the admin will have the following block:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/enableforseller.webp" alt="SET SHIPPING AS DEFAULT"></p><p>MultiVendor Marketplace Admin End</p><p>The admin can set any shipping enabled on his multivendor marketplace as default also.</p><p>Further, the admin can view all the sellers which are using this shipping method by going to:</p><p><strong>Multi-vendor marketplace admin panel</strong> &gt; <strong>configuration</strong> &gt; <strong>shipping</strong> <strong>configuration</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/viewsellersvamaship.webp" alt="VIEW SELLERS"></p><p>MultiVendor Marketplace Admin End</p><h2 id="make-shipping-address-phone-number-mandatory" tabindex="-1">Make <strong>Shipping</strong> <strong>Address Phone Number</strong> Mandatory <a class="header-anchor" href="#make-shipping-address-phone-number-mandatory" aria-label="Permalink to &quot;Make **Shipping** **Address Phone Number** Mandatory&quot;">​</a></h2><p>The admin needs to make the <strong>Shipping</strong> <strong>address phone number mandatory</strong> at the time of <strong>checkout</strong>.</p><p>So, go to <strong>Shopify Backend</strong> &gt; <strong>Settings</strong> &gt; <strong>Checkout</strong> &gt; Under <strong>Form Options</strong>, make <strong>Shipping</strong> <strong>address phone number</strong> as <strong>Required</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/demo-store-Checkout-Shopify.png" alt="PHONE NUMBER REQUIRED"></p><p>Shopify Backend (Admin End)</p><h3 id="configuration-seller-end" tabindex="-1">Configuration: Seller End <a class="header-anchor" href="#configuration-seller-end" aria-label="Permalink to &quot;Configuration: Seller End&quot;">​</a></h3><p><strong>Note: Seller address &amp; phone number is mandatory.</strong></p><p>Further, the seller can configuration Vamashipping from his panel.</p><p>So, go to <strong>multi vendor marketplace seller panel</strong> &gt; <strong>configuration</strong> &gt; <strong>shipping configuration</strong> &gt; <strong>enable</strong> the shipping:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/sellerenablevama.webp" alt="ENABLE"></p><p>MultiVendor Marketplace Seller End</p><p>Further, go to <strong>Global Configuration</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/globalconfig.webp" alt="GLOBAL CONFIGURATION"></p><p>MultiVendor Marketplace Seller End</p><p>Moreover, from here, the seller can do the <strong>SHIPPING PACKET CONFIGURATION</strong>:</p><p><strong>Note:</strong> 150 cm &gt; <strong>LBH</strong> &gt; 1 cm<br> In the case of <strong>Vamaship Air Domestic</strong>: 150 cm &gt; <strong>LBH</strong> &gt; 3 cm</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/globalconfigseller.webp" alt="SHIPPING PACKET CONFIGURATION"></p><p>MultiVendor Marketplace Seller End</p><p>Further, the seller can set the shipping method as <strong>by-default</strong>. So that every single product created it will have <strong>Vamaship Shipping</strong> as the <strong>by-default shipping method</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Shipping-Configuration-Seller-%E2%80%A2-Multivendor-MarketPlace-3.png" alt="SET AS DEFAULT"></p><p>MultiVendor Marketplace Seller End</p><p>If not this, the seller can set the shipping method on individual products while adding/editing them.</p><p>So, go to <strong>Multi-vendor marketplace seller panel</strong> &gt; <strong>Products</strong> &gt;<strong>Product Listing</strong> &gt; <strong>Add</strong>/<strong>Edit</strong> the Product:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Screenshot-from-2019-09-16-14-38-02.png" alt="REQUIRES SHIPPING"></p><p>MultiVendor Marketplace Seller End</p><h2 id="shopify-store-frontend" tabindex="-1">Shopify Store Frontend <a class="header-anchor" href="#shopify-store-frontend" aria-label="Permalink to &quot;Shopify Store Frontend&quot;">​</a></h2><p>Further, the customer will have an option to select the shipping method as <strong>Vamaship</strong> after entering the information:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Shipping-demo-store-Checkout.png" alt="CHECKOUT PAGE"></p><p>Shopify Storefront</p><h2 id="shipping-label-generation" tabindex="-1">Shipping Label Generation <a class="header-anchor" href="#shipping-label-generation" aria-label="Permalink to &quot;Shipping Label Generation&quot;">​</a></h2><p>Seller will have an option to generate a shipping label from their seller panel. Also, shipping labels can only be generated for <strong>fulfilled orders</strong>.</p><p>So, go to <strong>Multi-vendor marketplace seller panel</strong> &gt; <strong>Orders</strong> &gt; <strong>Order Listing</strong> &gt; <strong>View</strong> (under <strong>Action</strong>). In ADDITIONAL ORDER DETAILS, click on <strong>Actions</strong> &gt; <strong>Print Shipping Label</strong>:</p><p>Moreover, this block will have the information regarding who is bearing the shipping label charges. (Refer to the screenshot below.)</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/generateshiipinglabel.webp" alt="PRINT SHIPPING LABEL "></p><p>Furthermore, this is how the shipping label will be downloaded in pdf form:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Screenshot-from-2019-09-16-17-10-17.png" alt="SHIPPING LABEL"></p><p>Vamaship Shipping Label</p>',88)])])}const m=t(a,[["render",i]]);export{c as __pageData,m as default};
